							"<uitk:icon-font ng-if='model.open' icon='cux-icon-caret_down_centered'></uitk:icon-font>",
							"<uitk:icon-font ng-if='!model.open' icon='cux-icon-caret_right'></uitk:icon-font>",
							"<span uitk-panel-compile-header='model.title'></span>",
			           		"</a>",
