			$scope.initialValue = $scope.model;

			if($scope.checkFieldValidation === undefined) {
				$scope.checkFieldValidation = false;
			}

			$scope.isFormLayoutChild = fieldCtrl && fieldCtrl.isFormField();

			$scope.txtAreaSize = {
				width: $scope.width,
				height: $scope.height
			};

